  "text" : "\uCF08\uB808\uACE0\uB984\uC774 \uCFE0\uB8E8\uD540\uC5D0\uAC8C \uC5C4\uCCAD\uB098\uAC8C \uD654\uB0B8 \uC801 \uC788\uC74C \uC88B\uACA0\uB2E4. \uD3C9\uC18C\uC5D4 \uC9DC\uC99D\uB0B4\uB2E4\uAC00\uB3C4 \uCFE0\uB8E8\uD540\uC774 \uD765\uCE6B\uD54F \uBFE1\uBFE1\uD558\uAC70\uB098 \uC560\uAD50\uB5A8\uBA74 \uAE08\uBC29 \uD480\uC5B4\uC84C\uB294\uB370, \uC815\uB9D0 \uC81C\uB300\uB85C \uD654\uB098\uC11C \uB9D0\uB3C4 \uC548 \uAC78\uACE0 \uCCD0\uB2E4\uBCF4\uC9C0\uB3C4 \uC54A\uACE0 \uC5C6\uB294 \uC0AC\uB78C \uCDE8\uAE09\uD558\uB294 \uCF08\uB808\uACE0\uB974\uBC0D",
