  "text" : "\uAC04\uB9CC\uC5D0 \uD540\uC6E8\uD398\uC544\uB85C \uD540\uC6E8\uAC00 \uC790\uAE30\uC5D0\uAC8C \uD754\uC801\uC744 \uC548 \uB0A8\uACA8\uC918\uC11C \uB0B4\uC2EC \uC11C\uC6B4\uD55C \uD398\uC544\uB178\uB974 \uBCF4\uACE0 \uC2F6\uB2E4. \uD540\uC6E8\uAC00 \uADF8\uB9CC\uD07C \uC790\uAE30\uC5D0\uAC8C \uC18C\uC720\uC695\uC744 \uD45C\uC2DC\uD574\uC92C\uC74C \uC2F6\uAE30\uB3C4 \uD558\uACE0, \uB0A8\uC740 \uD754\uC801\uC744 \uBCF4\uBA70 \uC9C0\uB09C \uBC24\uC744 \uB5A0\uC62C\uB9AC\uACE0 \uC2F6\uAE30\uB3C4 \uD558\uACE0 \uD574\uC11C.",
