  "text" : "\uBA5C\uCF54\uB974\uAC00 \uD540\uACE8\uD540 \uC794\uC5D0 \uB3C5 \uD0D4\uB294\uB370 \uC6B4\uBA85\uC758 \uC7A5\uB09C\uC73C\uB85C \uD398\uC544\uB178\uB974\uAC00 \uBA39\uB294 \uAC70 \uBCF4\uACE0 \uC2F6\uB2E4. \uADF8\uB0E5 \uD53C \uD1A0\uD558\uB294 \uD398\uC544\uB178\uB974\uAC00 \uBCF4\uACE0 \uC2F6\uC5C8...\uC544\uB4E4\uC774 \uB208\uC55E\uC5D0\uC11C \uC4F0\uB7EC\uC9C0\uB2C8\uAE4C \uD540\uC6E8\uB294 \uB300\uD328\uB2C9. \uD540\uACE8\uD540\uC774 \uBC94\uC778\uC744 \uCC3E\uC73C\uB824 \uC9C0\uC2DC\uB0B4\uB9AC\uB294 \uAC00\uC6B4\uB370 \uBA5C\uCF54\uB974\uAC00 \uBA40\uB9AC\uC11C \uC6C3\uB294 \uAC78 \uBC1C\uACAC\uD55C\uB2E4\uB4E0\uAC00?",
