  "text" : "\uCFE0\uB8E8\uCF08\uB808\uC758 \uC580\uB370\uB808\uC801 \uC0C1\uD669\uC740 \uC785\uC220\uC744 \uB9E4\uB9CC\uC9C0\uBA70 '\uB124\uAC00 \uB0A0 \uB9DD\uCCE4\uC5B4'\uB77C\uACE0 \uB9D0\uD569\uB2C8\uB2E4, \uACB0\uB9D0\uC740 \uBD84\uC0B4\uC785\uB2C8\uB2E4.\n\uCFE0\uB8E8\uD540\uC774 \uC529 \uC6C3\uACE0 \uC788\uB294 \uCF08\uB808\uACE0\uB984\uC5D0\uAC8C \uB9D0\uD558\uB294? \uD615\uC774 \uB0A0 \uC774\uB807\uAC8C \uB9CC\uB4E4\uC5C8\uC5B4, \uD615\uC774 \uB0A0 \uB9DD\uCCE4\uC5B4. \uADF8\uB7EC\uB2C8\uAE4C \uB098\uB294 \uD615\uC774 \uC5C6\uC73C\uBA74 \uC548\uB3FC \uD558\uB294..",
