  "text" : "\uAC11\uC790\uAE30 \uB5A0\uC624\uB978 \uCFE0\uCF08\uB85C, \uC544\uCE68\uBD80\uD130 \uBE44\uC624\uB294 \uBC14\uB78C\uC5D0 \uC0AC\uB0E5\uC744 \uBABB \uAC00\uC11C \uB6B1\uD574 \uC788\uB294 \uCF08\uB808\uACE0\uB984\uACFC \uD558\uB8E8\uC885\uC77C \uCE68\uB300\uC5D0\uC11C \uB4B9\uAD6C\uB294 \uCFE0\uB8E8\uD540\uC774 \uBCF4\uACE0\uC2F6\uB2E4. \uCF08\uB808\uACE0\uB984\uC774 \uC9C0\uAE08\uC740 \uBE44\uAC00 \uADF8\uCCE4\uB098 \uD558\uACE0 \uACE0\uAC1C\uB4E4\uC5B4 \uCC3D \uBC16 \uBCF4\uB824\uACE0 \uD558\uBA74 \uCFE0\uB8E8\uD540\uC774 \uC790\uAFB8 \uD488\uC73C\uB85C \uB04C\uC5B4\uB2F9\uAE30\uB294..",
