  "text" : "RT @silmarillion_kr: \uADF8\uB9AC\uD558\uC5EC \uC5D0\uC62C\uC740 \uB9D0\uC5D0 \uC62C\uB77C\uD0C0\uACE0 \uB9D0\uD588\uB2E4. \"\uCFE0\uB8E8\uD540 \uACF5, \uC5B4\uB824\uC6B8 \uB54C \uB2E4\uC815\uD55C \uCE5C\uCC99\uC744 \uB9CC\uB098 \uBD59\uAC8C \uB418\uC5B4 \uACE0\uB9C8\uC6E0\uC2B5\uB2C8\uB2E4. \uB3CC\uC544\uC62C \uB54C \uAE30\uC5B5\uD558\uB3C4\uB85D \uD558\uACA0\uC2B5\uB2C8\uB2E4.\" \uADF8\uB7EC\uC790 \uCFE0\uB8E8\uD540\uC740 \uC5D0\uC62C\uC744 \uD5A5\uD574 \uD5D8\uC545\uD55C \uD45C\uC815\uC744 \uC9C0\uC5C8\uB2E4. \"\uB0B4 \uC55E\uC5D0\uC11C \uC544\u2026",
