    "text" : "\uD551\uACE4\uC758 \uB098\uB77C\uB294 \uC0AC\uB77C\uC84C\uACE0, \uD398\uC544\uB178\uB974\uC758 \uC544\uB4E4\uB4E4\uC740 \uBC14\uB78C \uC55E\uC758 \uB099\uC5FD\uCC98\uB7FC \uC720\uB791\uC758 \uAE38\uC744 \uB5A0\uB0AC\uB2E4. \uADF8\uB4E4\uC758 \uAD70\uB300\uB294 \uD769\uC5B4\uC84C\uACE0 \uB3D9\uB9F9\uC740 \uBD95\uAD34\uB418\uC5C8\uB2E4. \uADF8\uB4E4\uC740 \uC5D0\uB808\uB4DC \uB9B0\uB3C8 \uAE30\uC2AD\uC5D0\uC11C \uC57C\uC0DD\uC758 \uC232\uC18D \uC0DD\uD65C\uB85C \uC811\uC5B4\uB4E4\uC5C8\uACE0, \uACFC\uAC70\uC758 \uD798\uACFC \uC601\uAD11\uC744 \uC0C1\uC2E4\uD55C \uCC44 \uCD08\uB85D\uC694\uC815\uB4E4\uACFC \uC5B4\uC6B8\uB824 \uC0B4\uC558\uB2E4.",
