  "text" : "\uD398\uC544\uB178\uB974\uB294 \uBCF8 \uD22C \uBE44 \uB180\uB3C4\uB974\uB77C \uC678\uBAA8\uB3C4 \uC138\uBCF4\uC774\uACE0 \uC131\uACA9\uB3C4 \uAC15\uB82C\uD558\uACA0\uC9C0. \uC790\uC2DD\uB4E4\uB3C4 \uC678\uC591, \uB0B4\uBA74 \uBAA8\uB450 \uAC15\uD55C \uB180\uB3C4\uB974. \uD540\uACE8\uD540\uC740 \uC678\uBAA8, \uB0B4\uBA74 \uB2E4 \uBC14\uB0D0\uB974\uC758 \uBD80\uB4DC\uB7EC\uC6C0\uACFC \uB180\uB3C4\uB974\uC758 \uAC15\uC778\uD568\uC774 \uBC18\uBC18\uBB34\uB9C8\uB2C8. \uC790\uC2DD\uB4E4\uC740 \uB300\uCCB4\uB85C \uB180\uB3C4\uB974 \uC9C0\uD5A5\uC801\uC778\uB370 \uD22C\uB974\uACE4\uB9CC \uBC14\uB0D0\uB974\uC758 \uACF5\uC815\uD568\uC774\uB098",
