  "text" : "\uBBF8\uB9AC\uC5D8\uC774 \uC0B4\uC544\uC788\uC5C8\uB2E4\uBA74 \uD398\uC544\uB178\uB974\uB3C4 \uB3D9\uC0DD\uC744 \uAC16\uACE0 \uC2F6\uC5B4\uD558\uC9C0 \uC54A\uC558\uC744\uAE4C \uD558\uB294 \uC0DD\uAC01\uC774 \uB4E4\uC5C8\uB2E4. \uD558\uC9C0\uB9CC \uD604\uC2E4\uC740 \uC774\uBCF5\uB3D9\uC0DD \uD06C\uB9AC...\uADF8\uB798\uC11C \uC790\uC2E0\uC744 \uC678\uC544\uB4E4\uB85C \uC0DD\uAC01\uD558\uB294 \uD398\uC544\uB178\uB974\uB294 \uB300\uC2E0\uC5D0 \uB9C8\uC5D0\uB4DC\uB85C\uC2A4\uC5D0\uAC8C \uCE5C\uB3D9\uC0DD\uC744 \uB9CE\uC774 \uB9CC\uB4E4\uC5B4\uC92C\uB2E4\uAC70\uB098, \uACFC\uD560 \uC815\uB3C4\uB85C...",
