  "text" : "\uD55C \uCABD \uB208\uC744 \uC783\uACE0 \uC548\uB300\uD55C \uD398\uC544\uB178\uB974\uAC00 \uBCF4\uACE0 \uC2F6\uB2E4. \uBA5C\uCF54\uB974\uC5D0\uAC8C \uB04C\uB824\uAC14\uB2E4 \uACE0\uBB38\uB2F9\uD574\uC11C(\uAFB8\uC900) \uB2E4\uB978\uB370\uB294 \uAD6C\uCD9C \uD6C4 \uB2E4 \uD68C\uBCF5\uB410\uC9C0\uB9CC \uC783\uC5B4\uBC84\uB9B0 \uB208\uC740 \uC548 \uB3CC\uC544\uC624\uB294 \uAC70. \uBCF4\uC11D\uC744 \uB298\uC5B4\uB728\uB9B0 \uD654\uB824\uD55C \uAC80\uC740 \uC548\uB300\uB97C \uB4DC\uB7EC\uB0B4\uACE0 \uB2E4\uB2C8\uC9C0\uB9CC \uD63C\uC790 \uC788\uC744 \uB54C\uBA74 \uAC70\uC6B8 \uB2E4 \uAE68\uBC84\uB9AC\uB294..\uB9F9\uD558\uD6C4\uC138\uC694?",
