  "text" : "\uC5B4\uB9B0\uC774\uB0A0\uC774\uB2C8 \uC5B4\uB9B0 \uD540\uACE8\uD540\uC774 \uBCF4\uACE0 \uC2F6\uB2E4. \uAF2C\uB9C8 \uD53C\uB098\uB974\uD540 \uC190 \uC7A1\uACE0(\uB098\uC774\uCC28 \uBB34\uC2DC) \uC774\uBBF8 \uC5B4\uB978\uC778 \uD398\uC544\uB178\uB974 \uD615\uC5D0\uAC8C \uB2E4\uAC00\uAC14\uB2E4\uAC00 \uB300\uCC28\uAC8C \uAC70\uBD80\uB2F9\uD558\uB294 \uAC78\uB85C. \uD53C\uB098\uB974\uD540\uC740 \uC554\uAC83\uB3C4 \uBAB0\uB77C\uC11C \uC5B4\uB9AC\uB465\uC808\uD558\uACE0 \uD540\uACE8\uD540\uC740 \uB208\uBB3C \uADF8\uB801\uADF8\uB801\uB2EC\uACE0 \uD540\uC6E8\uD55C\uD14C \uB6F0\uC5B4\uAC00\uC11C \uC548\uACA8\uB77C",
