  "text" : "\uCF08\uB808\uBE0C\uB9BC\uBCF4\uB974\uB294 \uBB58 \uB9CC\uB4E4 \uC218 \uC788\uAC8C \uB410\uC744 \uB54C\uBD80\uD130 \uAC00\uC871\uB4E4\uC5D0\uAC8C \uC120\uBB3C\uD558\uAE30 \uC2DC\uC791\uD588\uC744 \uB4EF. \uB9C8\uC5D0\uB4DC\uB85C\uC2A4\uC5D0\uAC8C \uAC80 \uC7A5\uC2DD\uB048, \uB9C8\uAE00\uB85C\uB974\uC5D0\uAC90 \uC545\uAE30 \uD604, \uCF08\uB808\uACE0\uB984\uC5D0\uAC90 \uD654\uC0B4, \uCE74\uB780\uC2DC\uB974\uC5D0\uAC90 \uAE43\uD39C, \uC554\uC30D\uC5D0\uAC90 \uB611\uAC19\uC740 \uAC00\uC8FD \uBB3C\uD1B5, \uD398\uC544\uB178\uB974\uC640 \uB124\uB974\uB2E4\uB12C\uC5D0\uAC90 \uC870\uAC01\uCE7C \uD558\uB098\uC529.",
